// styles.js
import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: { 
    flex: 1, 
    padding: 16, 
    backgroundColor: "#F8FAFC" 
  },
  title: { 
    fontSize: 24, 
    fontWeight: "600", 
    marginBottom: 16 
  },
  chart: { 
    borderRadius: 16, 
    marginVertical: 8 
  },
  insights: { 
    flexDirection: "row", 
    justifyContent: "space-around", 
    marginTop: 16 
  },
  pill: {
    backgroundColor: "#F1F5F9",
    paddingVertical: 6,
    paddingHorizontal: 12,
    borderRadius: 20,
    fontSize: 14,
    fontWeight: "500",
    color: "#0F172A",
  },
});
